import './App.css';
import Navbar from './components/navbar/navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import Category from './pages/Category';
import ProductCataloge from './pages/ProductCataloge';
import ProductCart from './pages/ProductCart';
import LoginSignup from './pages/LoginSignup';
function App() {
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/mens' element={<Category category="mens" />} />
          <Route path='/womens' element={<Category category="womens" />} />
          <Route path='/kids' element={<Category category="kids" />} />
          <Route path='/product' element={<ProductCataloge />}>
            <Route path=':productId' element={<ProductCataloge />} />
          </Route>
          <Route path='/ProductCart' element={<ProductCart />} />
          <Route path='/LoginSignup' element={<LoginSignup />} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
